import os
import random
import urllib.request
import tarfile

number_of_images_each_folder_train = 5
number_of_images_each_folder_test = 1

def download_file(url, file_name):
    urllib.request.urlretrieve(url, file_name)

def extract_tar(file_name, extract_folder):
    with tarfile.open(file_name, "r") as tar:
        tar.extractall(extract_folder)

def random_select_images(source_folder, destination_folder, num_images):
    files = os.listdir(source_folder)
    random.shuffle(files)
    selected_files = files[:num_images]
    for file in selected_files:
        source_path = os.path.join(source_folder, file)
        destination_path = os.path.join(destination_folder, file)
        os.rename(source_path, destination_path)

def delete_file(file_name):
    os.remove(file_name)

for cdn_url in cdn_list:
    download_file(cdn_url, "dataset.tar")
    extract_tar("dataset.tar", "data/train/images")
    random_select_images("data/val/images", "data/train/val", number_of_images_each_folder_test)
    random_select_images("data/train/images", "data/train/images", number_of_images_each_folder_train)
    delete_file("dataset.tar")